  false,\n\t\"url\": null,\n\t\"notes\": \"This study was conducted during the summer
  of 1995 as a special project. Other assigned work took precedent. Also, the summer
  proved to be one of the driest in New England history, see Figure l, drastically
  reducing the number of fungi species found and identified. This study was premised
  on the knowledge that fungi has an important role to play in a forestry eco-system
  and that any management practice that alters that system should take fungi, as well
  as other factors into account.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
